import React, {Component} from "react";
import './App.css';
import Navbar from "./components/Navbar/Navbar";
import SecondPost from "./components/SecondPost/SecondPost";
import {BrowserRouter, Routes, Route, Link} from "react-router-dom";
import {updateNewPostText} from "./redux/store";
import Car from "./components/Car/Car";
import ProfileContainer from "./components/Profile/ProfileContainer";
import CarContainer from "./components/Car/CarContainer";
import UsersContainer from "./components/Users/UsersContainer";
import ProfileObert from "./components/Profile/ProfileObert";
import ProfileBossContainer from "./components/Profile/ProfileBossContainer";
import HeaderContainer from "./components/Header/HeaderContainer";
import Login from "./components/Login/Login";
import DialogsContainer from "./components/Dialogs/DialogsContainer";


class App extends Component {
    render() {
        return (
            <div className="app-wrapper">
                <HeaderContainer/>
                <Navbar/>
                <div className='app-wrapper-content'>
                    <Route path="/profile/:userId?"
                           render={() => <ProfileBossContainer/>}/>
                    <Route path="/Car/"
                           render={() => <CarContainer/>}/>
                    <Route path="/users/"
                           render={() => <UsersContainer/>}/>
                    <Route path="/login/"
                           render={() => <Login/>}/>
                    <Route path="/dialogs/"
                           render={() => <DialogsContainer/>}/>
                </div>
            </div>
            /*<div className="app-wrapper"> // для реакт роутер дом выше 6.0
